import React, {useEffect, useState} from 'react';
import './HomePage.css';

import {getCamp} from "../../services/camp";

export default function HomePage() {
    const [list, setList] = useState([]);

    // @ts-ignore
    useEffect(() => {
        let mounted = true;
        getCamp()
            .then(camp => {
                if(mounted) {
                    setList(camp)
                }
            })
        return () => mounted = false;
    }, [])

    return (
        <div className="wrapper">
            <h1>My Grocery List</h1>
            <ul>
                {list.map(camp => <li key={camp}>{camp}</li>)}
            </ul>
        </div>
    )

}
